import PageContent from "../components/PageContent";
import { useRouterError } from 'react-router-dom';



function ErrorPage() {
  const error = useRouterError();
  return (
    <PageContent title="An error occured">
      <p> Something went wrong</p>
    </PageContent>
  );
}

export default ErrorPage;
